import React from "react";
import Menu from "./MenuItem";
import "./ProductGrid.css";

const ProductGrid = ({ productName, backdgroundColor, textColor }) => {
  let menuItems = [
    {
      firstName: "FRAPPU",
      lastName: "CHOCO",
      price: "29.000VND",
      index: 1,
    },
  ];
  return (
    <div className="grid">
      <Menu className="item" menuItems={menuItems} />
    </div>
  );
};

export default ProductGrid;
